query QueryRenderersCityBMWListQuery(
  $citySlug: String!
) {
  city(slug: $citySlug) {
    ...CityBMWList_city
  }
}

fragment CityBMWList_city on City {
  shows(discoverable: true, first: 20, after: "", sort: START_AT_ASC) {
    edges {
      node {
        id
        _id
        __id
        name
        status
        href
        is_followed
        exhibition_period
        cover_image {
          url
        }
        location {
          coordinates {
            lat
            lng
          }
          __id
        }
        type
        start_at
        end_at
        partner {
          __typename
          ... on Partner {
            name
            type
          }
          ... on ExternalPartner {
            name
            __id
          }
          ... on Node {
            __id
          }
        }
      }
    }
  }
}
